;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;worksheets.chaos/inferred-trajetories</span>","value":"#'worksheets.chaos/inferred-trajetories"}
;; <=

;; **
;;; Log marginal as a function of BOPP iteration.  Note this can go down because BOPP is trying to estimate the variance in the estimator at the same time and so may decide that a previously supposedly good result more chance then good parameters.
;; **

;; @@
(plot/list-plot (map vector (range 1 (inc (count samples))) (map second samples))
                :x-title "Iteration"
                :y-title "Log marginal p(y)"
                :joined true)
